import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
    {
        Header: "Customer_name",
        accessor:"cust_name"
   },
   {
        Header: "Customer_number",
        accessor:"cust_num"
   },
   {
        Header: "Invoice_number",
        accessor:"cust_name"
   },
   {
        Header: "Invoice_amount",
        accessor:"cust_name"
   },
   {
        Header: "Due_date",
        accessor:"cust_name"
   },
   {
        Header: "Predicted Payment Date",
        accessor:"cust_name"
   },
   {
        Header: "Predicted Aging Bucket",
        accessor:"cust_name"
   },
   {
        Header: "Notes",
        accessor:"cust_name"
   },
];

const rows = [
  { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
  { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
  { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
  { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
  { id: 5, lastName: 'Targaryen', firstName: 'Daenerys', age: null },
  { id: 6, lastName: 'Melisandre', firstName: null, age: 150 },
  { id: 7, lastName: 'Clifford', firstName: 'Ferrara', age: 44 },
  { id: 8, lastName: 'Frances', firstName: 'Rossini', age: 36 },
  { id: 9, lastName: 'Roxie', firstName: 'Harvey', age: 65 },
];

export default function DataTable() {
  return (
    <div style={{ height: 400, width: '100%', color:'white'}}>
      <DataGrid  className="row-data" rows={rows} columns={columns}  checkboxSelection />
    </div>
  );
}
